import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the featured products grid to appear
    await page.waitForSelector('#productsGrid .product-card', { timeout: 5000 });

    // Click the first product card to open the product detail modal
    const firstProductCard = await page.$('#productsGrid .product-card');
    await firstProductCard.click();

    // Wait for the product modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector('#productModal[style*="display: block"]', { timeout: 5000 });

    // Wait for the "Add to Wish List" button in the modal
    await page.waitForSelector('#productModal .add-to-wishlist', { timeout: 5000 });

    // Take screenshot before adding to wishlist
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // Click the "Add to Wish List" button
    const addToWishlistBtn = await page.$('#productModal .add-to-wishlist');
    await addToWishlistBtn.click();

    // Wait for the notification to appear
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to wishlist
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_added_to_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_added_to_wishlist.png'));

    // Close the modal by clicking the close button (span.close)
    const closeBtn = await page.$('#productModal .close');
    if (closeBtn) {
      await closeBtn.click();
    }

    // Go to the wishlist page (simulate by clicking "Your Wish List" link)
    // Try to find the first visible "Your Wish List" link
    const wishListLink = await page.$('a:text("Your Wish List")');
    if (wishListLink) {
      await wishListLink.click();
    } else {
      // fallback: try another selector
      const wishListLinkAlt = await page.$('//a[contains(text(),"Wish List")]');
      if (wishListLinkAlt) {
        await wishListLinkAlt.click();
      }
    }

    // Wait for wishlist page to load
    await page.waitForSelector('.wishlist-page', { timeout: 5000 });
    await page.waitForSelector('.wishlist-items', { timeout: 5000 });

    // Take screenshot of wishlist page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_wishlist_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_wishlist_page.png'));

    // Extract the title of the first wishlist item
    const wishlistTitle = await page.$eval('.wishlist-item .wishlist-title', el => el.textContent.trim());

    return {
      success: true,
      action: "Added the first product to the wishlist and verified it appears in the wishlist page.",
      extractedData: {
        wishlistFirstItemTitle: wishlistTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
